{
    "variables": [
        "x"
    ],
    "variable_ranges": {
        "x": [
            -1.0,
            10.0
        ]
    },
    "function": "x^x^x^x^x^x^x^x^x^x^x^x^x^x^x^x^x^x^x^x^x = exp(100 * x ^ x) * 10000000"
}
 Ждите завершения обраБОТки запроса.

